const Repo = (props) => {
    const repo = props.repo;
    const repoName = repo.name;
    const lastCommitDate = repo.updated_at;
    const creationDate = repo.created_at;
    let repoDescription;
    if (repo.description == null) {
        repoDescription = "N/A"
    }
    else {
        repoDescription = repo.description;
    }

  return (
    <div>
        <h1>{repoName}</h1>
        <p>{repoDescription}</p>
        <br/>
        <p><i>Created: {creationDate}</i></p>
        <p><i>Last updated: {lastCommitDate}</i></p>
    </div>
  )
}

export default Repo
